// src/components/Navbar.tsx

import React, { useContext } from "react";
import { Link } from "react-router-dom";
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  Grid,
  Tooltip,
} from "@mui/material";
import { AuthContext } from "../context/AuthContext";
import PhoneAndroidIcon from "@mui/icons-material/PhoneAndroid"; // Example icon, replace with your logo if available
import { useNavigate } from "react-router-dom";

const Navbar: React.FC = () => {
  const { token, role, logout } = useContext(AuthContext);
  const navigate = useNavigate(); // Initialize the navigate function

  const handleLogout = async () => {
    try {
      await logout(); // Perform the logout action
      navigate("/"); // Redirect to the homepage
    } catch (error) {
      console.error("Logout failed:", error);
      // Optionally, handle the error (e.g., display a notification)
    }
  };

  return (
    <AppBar position="static" color="default" elevation={1}>
      <Toolbar>
        {/* Logo and Title */}
        <Box sx={{ display: "flex", alignItems: "center", mr: 2 }}>
          {/* Replace PhoneAndroidIcon with your logo if available */}
          <IconButton
            edge="start"
            color="inherit"
            aria-label="logo"
            component={Link}
            to="/"
            sx={{ mr: 1 }}
          >
            <PhoneAndroidIcon />
          </IconButton>
          <Typography
            variant="h6"
            component={Link}
            to="/"
            sx={{
              textDecoration: "none",
              color: "inherit",
              fontWeight: "bold",
            }}
          >
            ניהול מלאי
          </Typography>
        </Box>

        {/* Spacer */}
        <Box sx={{ flexGrow: 1 }} />

        {/* Navigation Buttons */}
        {token ? (
          <Grid container spacing={1}>
            {/* Home Button */}
            <Grid item xs={6} sm="auto">
              <Tooltip title="דף הבית">
                <Button
                  color="inherit"
                  component={Link}
                  to="/"
                  fullWidth
                  sx={{
                    textTransform: "none",
                    fontSize: "1rem",
                    "&:hover": {
                      backgroundColor: "rgba(0, 0, 0, 0.04)",
                    },
                  }}
                >
                  דף בית
                </Button>
              </Tooltip>
            </Grid>

            {/* Create Branch Button (Visible Only to Admins) */}
            {role === "admin" && (
              <Grid item xs={6} sm="auto">
                <Tooltip title="צור סניף חדש">
                  <Button
                    color="inherit"
                    component={Link}
                    to="/create-branch"
                    fullWidth
                    sx={{
                      textTransform: "none",
                      fontSize: "1rem",
                      "&:hover": {
                        backgroundColor: "rgba(0, 0, 0, 0.04)",
                      },
                    }}
                  >
                    צור סניף
                  </Button>
                </Tooltip>
              </Grid>
            )}

            {/* Logout Button */}
            <Grid item xs={6} sm="auto">
              <Tooltip title="התנתק">
                <Button
                  color="inherit"
                  onClick={handleLogout}
                  fullWidth
                  sx={{
                    textTransform: "none",
                    fontSize: "1rem",
                    "&:hover": {
                      backgroundColor: "rgba(0, 0, 0, 0.04)",
                    },
                  }}
                >
                  התנתק
                </Button>
              </Tooltip>
            </Grid>
          </Grid>
        ) : (
          <Grid container spacing={1}>
            {/* Login Button */}
            <Grid item xs={6} sm="auto">
              <Tooltip title="התחבר">
                <Button
                  color="inherit"
                  component={Link}
                  to="/login"
                  fullWidth
                  sx={{
                    textTransform: "none",
                    fontSize: "1rem",
                    "&:hover": {
                      backgroundColor: "rgba(0, 0, 0, 0.04)",
                    },
                  }}
                >
                  התחבר
                </Button>
              </Tooltip>
            </Grid>
          </Grid>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
